void inorder(TreeNode* root, vector<int> &v) {
        
        if(root == NULL)                        return;
        
        inorder(root->left, v);
        v.push_back(root->val);
        inorder(root->right, v);
        
        return;
    }

void inorder(TreeNode* root, vector<int> &v) {
        
        if(root == NULL)                        return;
        
        inorder(root->left, v);
        v.push_back(root->val);
        inorder(root->right, v);
        
        return;
    }

int kthSmallest(TreeNode* root, int k) {
    
        vector<int> v;
        inorder(root, v);
        
        if(v.size() < k)                        return -1;
        
        return v[k-1];
    }

